import React from "react";

export default function Photos(props) {
  console.log(props.photos);
  let photos = props.photos.photos;
  console.log(photos);
  return (
    <section>
      {photos.map(function (photos, index) {
        return <img src={photos.src.landscape} key={index} />;
      })}
    </section>
  );
}
